exports.extract = function (FilePath) {
    const fs = require('fs');
    try {
        rawdata = fs.readFileSync(FilePath);
    }
    catch (e) {
        throw new Error(FilePath + " was not found !");
    }
    var Data = JSON.parse(rawdata);
    return Data;
}
